import React from "react";


export default function Footer() {
    return (
        <footer>
            <i class="fab fa-twitter"></i>
            <i class="fab fa-facebook"></i>
            <i class="fab fa-instagram"></i>
            <i class="fab fa-github"></i>
        </footer>
    )
}
